import Button from "./Button"
import * as styles from "./header.css"

export default function Header() {
    return (
        <div className={styles.header}>
            <Button text="Shop"/>
            <Button text="Reserve Room"/>
            <Button text="My Reservations"/>
            <Button text="My Bill"/>
        </div>
    )
}
